import React from 'react'



const HomeSlider = () => {
        const images = [
    {
      id: 1,
      title: "Pijamas",
      imageUrl: "images/uno.jpg",
    },
    {
      id: 2,
      title: "Batas",
      imageUrl: "images/dos.jpg",
    },
    {
      id: 3,
      title: "Pantuflas",
      imageUrl: "images/tres.jpg",
    },
    {
      id: 4,
      title: "Cojines",
      imageUrl: "images/cuatro.jpg",
    },

  ];
  return (
      <div
        >
             {images.map(({ url, title, id }) => (
            <img src={url} key={id} alt={title} />
          ))}

        </div>
  )
}

export default HomeSlider
